import React from 'react';
import image from '../images/image2.svg';
import Common from './Common';

const About = () => {
  return (
    <Common tagline='Welcome To About Page' img={image} imgstyle={{width:'600px' , height:'250px', backgroundColor:'red'}}/>
  )
}

export default About
